import React, { FunctionComponent } from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import SkinList from './pages/skin-list';
import SkinDetail from './pages/skin-detail';
import SkinAdd from './pages/skin-add';
import Home from './pages/home';
import CV from './pages/CV';
import Logo from './components/logo-grid/index';
import PageNotFound from './pages/not-found';
import SkinEdit from './pages/skin-edit';

const App: FunctionComponent = () => {

    const openUserSign = (type: string) => {
        var target = document.querySelector('.user-window')!.classList;
        if (type !== 'close') {
            if (target.value.includes('active-up') || target.value.includes('active-in')) {
                if (target.value.includes('active-up') && type === 'in') {
                    target.remove('active-up');
                    target.add('active-in');
                }
                else if (target.value.includes('active-in') && type === 'up') {
                    target.remove('active-in');
                    target.add('active-up');
                }
            }
            else {
                target.add('active-' + type);
            }
        }
        else if (type === 'close') {
            target.remove('active-up');
            target.remove('active-in');
        }
    }
    return (
        <Router>
            <div>
                <nav className="header flex-bet flex-row flex-center-x flex-center-y header w100 zi9 active-in">

                    <Link to="/">
                        <Logo sizeblocs={0.9} hover={true}/>
                    </Link>

                    <div className="header__user-part flex-row w20 w50-tab flex-bet">
                        <div className='cta' onClick={() => openUserSign("in")}>
                            <span>
                                Sign In
                            </span>
                        </div>
                        <div className='cta' onClick={() => openUserSign("up")}>
                            <span>
                                Sign Up
                            </span>
                        </div>
                    </div>
                </nav>
                <div className="header__marge"></div>
                <Switch>
                    <Route exact path="/" component={Home}></Route>
                    <Route exact path="/skins" component={SkinList}></Route>
                    <Route exact path="/skins/add" component={SkinAdd}></Route>
                    <Route exact path="/skins/edit/:id" component={SkinEdit}></Route>
                    <Route exact path="/skins/:id" component={SkinDetail}></Route>
                    <Route exact path="/curiculum-vitae" component={CV}></Route>
                    <Route component={PageNotFound}></Route>
                </Switch>

            </div>
            <div className='user-window absolute r5 t15 w80-tab p20 flex-center flex-col zi9'>
                <div className='user-window__head flex-row w80 flex-around'>
                    <h2 className='user-window__head__in-title' onClick={() => openUserSign("in")}>Sign In</h2>
                    <h2 className='user-window__head__up-title' onClick={() => openUserSign("up")}>Sign Up</h2>
                </div>

                <div className="user-window__close absolute t5 r5" onClick={() => openUserSign("close")}></div>

                <div className="user-window__bloc flex-start-x w100 flex-row">

                    <div className="user-window__bloc__in flex-col g15 flex-center w100">
                        <div className='user-window__bloc__in__form flex-col flex-center-y flex-start-x w80'>
                            <p className='user-window__bloc__in__form__title b10'>Email</p>
                            <input className='user-window__bloc__in__form__input w100' type="text" />
                            <p className='user-window__bloc__in__form__title b10'>password</p>
                            <input className='user-window__bloc__in__form__input w100' type="password" />
                        </div>

                        <div className='user-window__bloc__in__button flex-col flex-center-y flex-start-x mb15 mt15'>
                            <div className='cta'>
                                <span>
                                    Sign In
                                </span>
                            </div>
                        </div>
                    </div>

                    <div className="user-window__bloc__up flex-col g15 flex-center w100">
                        <div className='user-window__bloc__up__form flex-col flex-center-y flex-start-x w80'>
                            <p className='user-window__bloc__up__form__title b10'>Pseudo</p>
                            <input className='user-window__bloc__up__form__input w100' type="text" />
                            <p className='user-window__bloc__up__form__title b10'>Email</p>
                            <input className='user-window__bloc__up__form__input w100' type="text" />
                            <p className='user-window__bloc__up__form__title b10'>password</p>
                            <input className='user-window__bloc__up__form__input w100' type="password" />
                            <p className='user-window__bloc__up__form__title b10'>Confirm password</p>
                            <input className='user-window__bloc__up__form__input w100' type="password" />
                        </div>

                        <div className='user-window__bloc__in__button flex-col flex-center-y flex-start-x mb15 mt15'>
                            <div className='cta'>
                                <span>
                                    Sign Up
                                </span>
                            </div>
                        </div>
                    </div>

                </div>

            </div>
        </Router>

    )
}

export default App;
